import React, {useState, useEffect} from 'react';
import { getBlogEntries, createBlogEntry } from './BlogQueries';

const BlogEntries = params => {

    let [blogEntries, setBlogEntries] = useState([]);

    useEffect(()=>{
        getBlogEntries(res => setBlogEntries(res));
    });

    return(
        <div>
            <form>
                <input type="text" name="title" ></input>
            </form>
            {blogEntries.map(e=>{
            <p>{e.title}</p>  
            })}
        </div>
    );
}
